import React from "react";
const adduser = () => {
  return (
    <form>
      <label htmlFor="username">Username</label>
      <input id="username" type="text"></input>
      <label htmlFor="age">Age(years)</label>
      <input id="username" type="number"></input>
    </form>
  );
};
export default adduser;
